Using a food processor, use the pulse button to blend together bread pieces; grated Parmesan cheese; parsley; salt; and pepper. {"smallUrl":"https://www.wikihow.com/images/thumb/b/b1/Fry-Breaded-Chicken-Strips-Step-2Bullet6-Version-2.jpg/v4-459px-Fry-Breaded-Chicken-Strips-Step-2Bullet6-Version-2.jpg","bigUrl":"https://www.wikihow.com/images/thumb/b/b1/Fry-Breaded-Chicken-Strips-Step-2Bullet6-Version-2.jpg/v4-759px-Fry-Breaded-Chicken-Strips-Step-2Bullet6-Version-2.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":506.31868131868134,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
